Contoh program sederhana di bahasa Go

package main

import fmt

func main() {
 fmt.Println(Hello, World!)
} .

1. Install swagger

Untuk memulai, Anda harus menginstal swaggger. Swagger adalah alat yang memungkinkan Anda untuk mengkonversi dokumentasi API Anda menjadi format Swagger. Anda dapat menginstal swag dengan menjalankan perintah berikut di terminal Anda:

```
go get -u github.com/swaggo/swag/cmd/swag
```

2. Buat dokumentasi API

Setelah Anda menginstal swag, Anda dapat mulai membuat dokumentasi API Anda. Anda dapat melakukan ini dengan menambahkan komentar di setiap fungsi API Anda. Komentar ini harus menggunakan format yang ditentukan oleh swag. Sebagai contoh, berikut adalah komentar yang dapat Anda tambahkan di fungsi API Anda:

```
// @Summary Get user by ID
// @Description Get user by ID
// @ID get-user-by-id
// @Tags users
// @Accept  json
// @Produce  json
// @Param id path int true ""User ID""
// @Success 200 {object} models.User
// @Failure 400 {object} models.Error
// @Router /users/{id} [get]
```

3. Generate Swagger

Setelah Anda menambahkan komentar di setiap fungsi API Anda, Anda dapat menggunakan swag untuk mengkonversi dokumentasi API Anda menjadi format Swagger. Anda dapat melakukan ini dengan menjalankan perintah berikut di terminal Anda:

```
swag init
```

Perintah ini akan menghasilkan file swagger.json yang berisi dokumentasi API Anda dalam format Swagger. Anda dapat menggunakan file ini untuk mengintegrasikan dokumentasi API Anda dengan berbagai layanan seperti Swagger UI.

package main

import """"fmt""""

type Person struct {
 Name string
 Age  int
}

func main() {
	p := Person{
 Name: """"John Doe"""",
Age:  25,
	}
	fmt.Println(p)
}"

